			shellScript = "# Type a script or drag a script file from your workspace to insert its path.\n# skip if we run in debug\nif [ \"$CONFIGURATION\" == \"Debug\" ]; then\necho \"Skip frameworks cleaning in debug version\"\nexit 0\nfi\n\nAPP_PATH=\"${TARGET_BUILD_DIR}/${WRAPPER_NAME}\"\necho \"APP_PATH is $APP_PATH\"\n\n# This script loops through the frameworks embedded in the application and\n# removes unused architectures.\nfind \"$APP_PATH\" -name '*.framework' -type d | while read -r FRAMEWORK\ndo\n    echo \"Framework is $FRAMEWORK\"\n    \n    # Skip stripping the AgoraRtc and BanubaSdk frameworks.\n    if [[ $FRAMEWORK == *\"AgoraRtcEngineKit.framework\" ]]; then\n        echo \"Skipping $FRAMEWORK\"\n    elif [[ $FRAMEWORK == *\"BanubaSdk.framework\" ]]; then\n        echo \"Skipping $FRAMEWORK\"\n    else\n        echo \"NOT skipping $FRAMEWORK\"\n        FRAMEWORK_EXECUTABLE_NAME=$(defaults read \"$FRAMEWORK/Info.plist\" CFBundleExecutable)\n        FRAMEWORK_EXECUTABLE_PATH=\"$FRAMEWORK/$FRAMEWORK_EXECUTABLE_NAME\"\n        echo \"Executable is $FRAMEWORK_EXECUTABLE_PATH\"\n\n        EXTRACTED_ARCHS=()\n\n        for ARCH in $ARCHS\n        do\n            echo \"Extracting $ARCH from $FRAMEWORK_EXECUTABLE_NAME\"\n            lipo -extract \"$ARCH\" \"$FRAMEWORK_EXECUTABLE_PATH\" -o \"$FRAMEWORK_EXECUTABLE_PATH-$ARCH\"\n            EXTRACTED_ARCHS+=(\"$FRAMEWORK_EXECUTABLE_PATH-$ARCH\")\n        done\n\n        echo \"Merging extracted architectures: ${ARCHS}\"\n        lipo -o \"$FRAMEWORK_EXECUTABLE_PATH-merged\" -create \"${EXTRACTED_ARCHS[@]}\"\n        rm \"${EXTRACTED_ARCHS[@]}\"\n\n        echo \"Replacing original executable with thinned version\"\n        rm \"$FRAMEWORK_EXECUTABLE_PATH\"\n        mv \"$FRAMEWORK_EXECUTABLE_PATH-merged\" \"$FRAMEWORK_EXECUTABLE_PATH\"\n    fi\n\ndone\n";
		};
